import React from "react";

const Login = () => (
  <nav className="login">
    <h2>Inventory Login</h2>
    <p>Sign in to manage your store's inventory.</p>
    <button className="github" onClick={() => this.props.authenticate("Github")}>Sign in with Github</button>
    <button className="facebook" onClick={() => this.props.authenticate("Facebook")}>Sign in with Facebook</button>
    <button className="twitter" onClick={() => this.props.authenticate("Twitter")}>Sign in with Twitter</button>
    <button className="google" onClick={() => this.props.authenticate("Google")}>Sign in with Google</button>
  </nav>
);

export default Login;
